E_WHISH1:"Iespēja izvēlēties un pasūtīt tikai tās fotogrāfijas, kuras Jums iepatikās.",ABOUT_PAGE_WHISH2:"Iespēja saņemt ne tikai studijas fotogrāfijas, bet arī dzīvās fotogrāfijas no bērna ikdienas dzīves skolā vai bērnudārzā.",ABOUT_PAGE_WHISH3:"Iespēja ērti pasūtīt un apmaksāt pakalpojumu online.",ABOUT_PAGE_WHISH4:"Iespēja ērti lejuplādēt fotogrāfijas elektroniskā veidā.",ABOUT_PAGE_WHISH5:"Iespēja saņemt augstas kvalitātes fotogrāfijas no profesionāliem fotogrāfiem.",ABOUT_PAGE_WHISHES_DONE:"Visas vecāku prasības tika ņemtas vērā un realizētas!",ABOUT_PAGE_INVITE:"Aicinām Jūs bērnu fotostudijā FOTO ANGELS!",ABOUT_PAGE_MOTO:"Mēs palīdzēsim Jums un Jūsu bērniem saglabāt spilgtākās atmiņas no skolām un bērnudārziem!",SERVICES_PAGE_TITLE:"Mūsu pakalpojumi",SERVICES_PAGE_SESSIONS_TITLE:"Fotosesijas sākumskolām un vidusskolām.",SERVICES_PAGE_SESSIONS_P1:"Fotosesija skolai ir liels un sarežģīts projekts. Ierobežotā laikā ir nepieciešams katram bērnam nofotografēt individuālos portretus, fotogrāfijas ar klases biedriem un draugiem, kā arī fotogrāfijas no mācību procesa klasē. Pie tam ir jānodrošina augsta kvalitāte fotogrāfijām. Tāpēc bērnu fotostudija FOTO ANGELS izmanto uzreiz trīs fotogrāfus, kuri katrs specializējas noteiktajā fotografēšanas jomā.",SERVICES_PAGE_SESSIONS_P2:"Lai nodrošinātu fotogrāfiju kvalitāti, mēs izmantojam tikai profesionālu foto tehniku, kā arī labākās apgaismošanas iekārtas.",SERVICES_PAGE_SAMPLE_TITLE:"Padarītā darba piemēri:",SERVICES_PAGE_SESSIONS_KINDER_TITLE:"Fotosesijas bērnu dārziem",SERVICES_PAGE_SESSIONS_KINDER_P1:"Lai organizētu fotosesiju bērnudārzā, FOTO ANGELS fotogrāfu komandai ir jāpieceļas ļoti agri, jo vajag atbraukt un uzstādīt visu aparatūru no paša agra rīta, līdz brīdim, kamēr sāk ierasties bērniņi. Fotosesijā piedalās trīs fotogrāfi, kuri bildē individuālās un grupu fotogrāfijas. Pie tam viens no viņiem darbojas «neredzamā» režīmā un viņa uzdevums ir ķert dzīvos kadrus no bērniņa ikdienas aktivitātēm – kā zīmēšana, dejošana vai visādas blēņas.",SERVICES_PAGE_ALBUM_TITLE:"Izlaidumu albūmu izveidošana",SERVICES_PAGE_ALBUM_P1:"Dienas skrien ļoti ātri un nu jau pienāk izlaidumu laiks. Šis moments bērniem paliek atmiņā uz ilgu laiku, jo tas ir jauna dzīves etapa sākums. Lai kvalitatīvi saglabātu šīs atmiņas, Jūs variet pasūtīt smukus izlaiduma albūmus ar unikālu noformējumu. FOTO ANGELS dizaineri izveidos interesantu un kvalitatīvu izlaiduma albūmu vairākos variantos Jūsu izvēlei.",PRODUCTS_PAGE_TITLE:"Mūsu produkcija",PRODUCTS_PAGE_DESCRIPTION:"!!! ПЕРВОД ЭТОЙ СТРОКИ БУДЕТ В САМОМ КОНЦЕ ФАЙЛА",PRODUCTS_PAGE_PROD_PORTRAIT:"Studijas portrets uz gaiši balta fona",PRODUCTS_PAGE_PROD_FRIENDS:"Draugu foto ar dažādiem aksesuāriem",PRODUCTS_PAGE_PROD_LIVE:"Dzīvās bildes no klases vai bērnudārza",PRODUCTS_PAGE_PROD_CALENDARS:"Dažādu izmēru kalendāri",PRODUCTS_PAGE_PROD_COMPLECT_SM:'Komplekts "Mazais"',PRODUCTS_PAGE_PROD_COMPLECT_POP:'Komplekts "Paplašināts" ar magnētu dāvanā',PRODUCTS_PAGE_PROD_COMPLECT_PR:'Komplekts "Premium" ar jauku foto rāmi dāvanā',PRODUCTS_PAGE_PROD_CUP:"Klasiskās un maģiskās krūzes visai ģimenei",PRODUCTS_PAGE_PROD_SOUVENIRS:"Atslēgu piekariņi un magnēti ar diviem portretiem",PRODUCTS_PAGE_PROD_SERIES:"Dažādas portretu sērijas",PRODUCTS_PAGE_PROD_DESIGN:"Dažādi dizaina rāmji ar portretiem",PRODUCTS_PAGE_PROD_FRAMES:"Dažādu izmēru bilžu rāmji",PRODUCTS_PAGE_PROD_GROUP:"Lielās un mazās grupas bildes",PRODUCTS_PAGE_PROD_PILLOW:"Spilveni ar portretu",FROM:"no",THANK_YOU_TITLE:"Forši!",THANK_YOU_ORDER_ACCEPTED:"Tavs pasūtījums ir pieņemts.",THANK_YOU_ORDER_ON_THE_WAY:"Paskaties, tas jau ceļo pie Tevis :)",THANK_YOU_EXPLANATION:"Pēc pasūtījumu pieņemšanas termiņa beigām, bezmakas un nopirktās preces tiks piegādātas uz skolu vai bērnudārzu 30 dienu laikā",THANK_YOU_DOWNLOADABLE:"Preces digitālā veidā būs pieejamas lejuplādei",THANK_YOU_BASKET_LINK:"“Jūsu pasūtījums”",THANK_YOU_MINS:"sadaļā dažu minūšu laikā.",THANK_YOU_RETURN:"Atgriezties pie fotogrāfiju izvēles",CANCELLED_TIT